import classes from './AvailableMeals.module.css';
import Card from '../UI/Card';


const DUMMY_MEALS = [
    {
      id: 'm1',
      name: 'Paneer Butter Masala',
      description: ' Rich and creamy dish of paneer (Indian cottage cheese) in a tomato, butter and cashew sauce.  ',
      price: 160,
    },
    {
      id: 'm2',
      name: 'Chicken Butter Masala',
      description: 'Popular Indian dish of grilled chicken simmered in a smooth, silky and creamy onion tomato and cashew gravy.',
      price: 180,
    },
    {
      id: 'm3',
      name: 'Butter Naan',
      description: 'Traditional Indian flatbread made with flour, yeast, salt, sugar, and yogurt',
      price: 40,
    },
    {
      id: 'm4',
      name: 'Jeera Rice',
      description: 'Rice cooked with cumin seeds & ghee or butter.',
      price: 90,
    },
  ];
const AvailableMeals=()=>{
    const mealsList=DUMMY_MEALS.map(meal=><li>{meal.name}</li>);

    return (<section className={classes.meals}>
        <card>
        <ul>
            {mealsList}
        </ul>
        </card>
    </section>
    );
};

export default AvailableMeals;
